tionImpl',dwc='DialogBox$MouseHandler',lpc="Die Wettbewerbskommission der Schweiz (Weko) nimmt Kooperationsvereinbarungen zwischen dem f\xFChrenden Telekommunikationsunternehmen Swisscom und \xF6rtlichen Stromversorgern beim Bau von Glasfasernetzen unter die Lupe. Die Swisscom hatte Mitte 2009 angek\xFCndigt, in Ballungsr\xE4umen mit Fibre-to-the-Home (FTTH) k\xFCnftig voll auf Glasfaser zu setzen. Bis 2015 will der Konzern die St\xE4dte Z\xFCrich, Genf, Basel, St. Gallen, Bern, Lausanne und den Kanton Freiburg fl\xE4chendeckend mit FTTH versorgen. Dabei setzt die Swisscom nicht nur auf selbst installierte Glasfaserinfrastrukturen, sondern das Unternehmen will nach M\xF6glichkeit auch Infrastrukturen nutzen, die bereits von \xF6rtlichen Elektrizit\xE4tsversorgern aufgebaut wurden, die den Ausbau eigener Glasfasernetze zuletzt stark vorangetrieben hatten. Und dies ist Wettbewerbern ein Dorn im Auge. So reichte etwa der Verband der Kabelnetzbetreiber, Swisscable, im Mai 2010 Beschwerde bei der Weko wegen eines Kooperationsvertrages zwischen der Stadt St. Gallen und Swisscom ein. Der Vorwurf: Marktmissbrauch. Weko-Angaben zufolge gingen in den vergangenen Monaten noch weitere Meldungen zu Kooperationen zwischen Elektrizit\xE4tsversorgern und der Swisscom bei der Wettbewerbsbeh\xF6rde ein. Als erste Stadt habe St. Gallen einzelne Klauseln ihres Kooperationsvertrages im Rahmen eines Widerspruchsverfahrens zur \xDCberpr\xFCfung gemeldet, weshalb diese Kooperation auch als erste beurteilt werde. Bei diesen Vertragsklauseln sehe die Weko teilweise 'wettbewerbsrechtliche Probleme', weshalb sie jetzt eine Vorabkl\xE4rung er\xF6ffnet habe. Die ausgehandelten Vertragsklauseln, so die Weko, 'k\xF6nnten gem\xE4\xDF einer ersten Einsch\xE4tzung den Wettbewerb nachhaltig beschr\xE4nken und langfristig zu einer Monopolisierung der Glasfasernetzinfrastruktur f\xFChren'. Ins Visier nehmen die Wettbewerbsh\xFCter auch die geplante Gr\xFCndung eines Gemeinschaftsunternehmens zwischen der Swisscom und dem Energieversorger Groupe E zum Aufbau und Betrieb einer gemeinsamen Glasfaserinfrastruktur im Kanton Freiburg. Hier best\xFCnden Anhaltspunkte, dass das Gemeinschaftsunternehmen 'eine marktbeherrschende Stellung begr\xFCndet oder verst\xE4rkt'. (pmz) ",Szc='Dimension',plc='Dimension [height=',fwc='DirectionalTextHelper',iwc='DockLayoutPanel',jwc='DockLayoutPanel$Direction',kwc='DockLayoutPanel$Direction;',nwc='DockLayoutPanel$DockAnimateCommand',lwc='DockLayoutPanel$LayoutData',rsc='DomEvent',wsc='DomEvent$Type',Ayc='Double',lic='EAST',Scc='EEE, d MMM yyyy HH:mm:ss Z',hoc='EEE. dd MMM. yyyy HH:mm:ss',Sdc='EEEE MMMM d',rec='EEEE, MMMM d',nec='EEEE, MMMM d, y',Odc='EEEE, y MMMM dd',tac='EM',ogc='EMPTY',tgc='ENABLED',Lec='END',vac='EX',Muc='ElementMapperImpl',Nuc='ElementMapperImpl$FreeNode',mec='English',Drc='Enum',dec='Etc/GMT',fec='Etc/GMT+',eec='Etc/GMT-',Nac='Event type',Gxc='Event$NativePreviewEvent',Jsc='EventBus',Tqc='EventObject',Yqc='Exception',Sgc='Expecting version 6 from server, got ',Jbc='F',qmc='F8834F07517EF3B7D02B9E845E5E1B88',oac='FIXED',ohc='FLOAT',Xlc='Fail: ',bcc='Feb',Rbc='February',Mpc='Female',Byc='Float',owc='FlowPanel',Ovc='FocusWidget',rkc='For input string: "',Fcc='Fri',ycc='Friday',_ac='GET',yoc='GGD55XLBAH',iqc='GGD55XLBAJ',vpc='GGD55XLBBI',xoc='GGD55XLBCH',xpc='GGD55XLBCI',Rfc='GGD55XLBDB',woc='GGD55XLBDH',rqc='GGD55XLBDJ',epc='GGD55XLBDK',Efc='GGD55XLBEB',uoc='GGD55XLBEH',wpc='GGD55XLBEI',jqc='GGD55XLBEJ',Sfc='GGD55XLBFB',Boc='GGD55XLBFH',Upc='GGD55XLBFI',Kqc='GGD55XLBFK',Rpc='GGD55XLBGI',Iqc='GGD55XLBGK',Vfc='GGD55XLBHB',Joc='GGD55XLBHH',Fpc='GGD55XLBHI',Hqc='GGD55XLBHK',Loc='GGD55XLBIH',Eqc='GGD55XLBIK',Koc='GGD55XLBJH',Gnc='GGD55XLBJJ',Jqc='GGD55XLBJK',Woc='GGD55XLBKG',qpc='GGD55XLBKH',Vpc='GGD55XLBKI',zqc='GGD55XLBKK',Toc='GGD55XLBLG',ppc='GGD55XLBLH',Npc='GGD55XLBLI',Aqc='GGD55XLBLK',$oc='GGD55XLBMG',opc='GGD55XLBMH',Knc='GGD55XLBMJ',Yoc='GGD55XLBNG',npc='GGD55XLBNH',yqc='GGD55XLBNK',lnc='GGD55XLBOG',rpc='GGD55XLBO
